	    "id": "ahJzfnNlYXJjaGJlcnRoYS1ocmRyFAsSB1Byb2dyYW0YgICAmIT8jQoM",
	    "description": "In keeping with ASCNYC's client-centered philosophy, a top priority is ensuring that our clients have adequate food, shelter, and clothing. Without first meeting these basic needs, it is impossible to effectively deliver other HIV/AIDS services. That's why ASCNYC operates a Direct Aid Emergency Assistance Program, an onsite Meal Program, and a Food Pantry and Clothing Bank. These programs help stabilize clients so that they may maximize their use of ASCNYC's broad range of services. To find out more about our Basic Needs Program or to make a donation of food or clothing, please contact Rosie Whiteside at (212) 645-0845 ext. 394, or via email at <a href=\"mailto:rosie2@ascnyc.org\">rosie2@ascnyc.org</a>.",
